"    (function(){

        var mainMessage = document.getElementsByClassName('login-section__error')[0];
        if(window.messageChangeObserver) {
            var message = {"message" : "validateHtmlErrorMessage", "messageText" : mainMessage.innerHTML };
            window.webkit.messageHandlers.UIDAIListener.postMessage(message);
            return;
        }
       const config = {characterData: true, attributes: true, childList: true, subtree: true };
       const callback = (mutationList, observer) => {
            for (const mutation of mutationList) {
                 var mainMessage = document.getElementsByClassName('login-section__error')[0];
                 var message = {"message" : "validateHtmlErrorMessage", "messageText" : mainMessage.innerHTML };
                 window.webkit.messageHandlers.UIDAIListener.postMessage(message);
            }
         };
    window.messageChangeObserver = new MutationObserver(callback);
    window.messageChangeObserver.observe(mainMessage, config);
    var message = {"message" : "validateHtmlErrorMessage", "messageText" : mainMessage.innerHTML };
    window.webkit.messageHandlers.UIDAIListener.postMessage(message);
})();"

